import React, {Component} from 'react';
import MyName from "./MyName";
import YourName from "./YouName";

class App extends Component {
  static defaultProps = {
    name: '종화니~!'
  }

  render() {
    return (
        <div>
          <MyName />
          <YourName names={"aaaa"} />
          asdasd
        </div>
    )
  }
}

export default App;
